        super(props)
        this.state = {
            show: [],
        }
    }
    static getDerivedStateFromProps(props,state){
        console.log(props);
        let name= props.str;
        let names= [];
        console.log(name);
        Axios.get("http://localhost:3001/search",{params: { name : name}}).then((response)=>{
            console.log(response.data);
            response.data.map((data,index)=>{
                console.log(response.data[index].name);
                names.push(response.data[index].name); 
            })
        });
        let dbdata = [];
        for(let i=0;i<names.length;i++){
            Axios.get("http://localhost:3001/profile",{params: { name : names[i].name }}).then((response)=>{
                dbdata.push(response.data);
                console.log(response.data);
            });
        }
        return ({show:[]});
    }
